import React from "react";
import "./heading.css";

function Heading() {
  return (
    <>
      <div id="heading">
        <p id="span1">EB</p>

        <p id="span2">ELITE <br></br>BANARAS</p>
      </div>
    </>
  );
}

export default Heading;
